import React, { Component } from 'react';
import Particles from 'react-particles-js';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
      <Particles
          params={{
      	    "particles": {
      	        "number": {
      	            "value": 100,
      	            "density": {
      	                "enable": false
      	            }
      	        },
      	        "size": {
      	            "value": 5,
      	            "random": true
      	        },
      	        "move": {
      	            "direction": "bottom",
      	            "out_mode": "out"
      	        },
      	        "line_linked": {
      	            "enable": false
      	        }
      	    }
      	}} />
        <nav class="navbar sticky-top navbar-light">
          <a class="navbar-brand" href="#"><strong>Portfolio!</strong></a>
        </nav>
          <h1><strong>Hi, my name is Phoenix!</strong></h1>
            <img src="https://camo.githubusercontent.com/3387142119eaf19786778d22c11e7930975096c5/68747470733a2f2f63646e2e7261776769742e636f6d2f66696c652d69636f6e732f736f757263652f6d61737465722f7376672f50686f656e69782e737667" className="bird-img" alt=""/>
          <h2><strong>Iâ€™m currently enrolled at a coding university called 42.</strong></h2>
      </div>
    );
  }
}

export default App;
